import React from 'react';
import {IoLogoGithub} from 'react-icons/io';

const navStyle = {
    height: '100px',
    backgroundColor: '#000000',
    marginTop: '0',
    color: '#FFFFFF',
    textAlign: 'center',
    verticalAlign: 'middle',
    lineHeight: '80px',
    boxShadow: '0px 4px 4px #191414',
    paddingTop: '10px'
}
const Navbar = () => {
    return (
        <div style={navStyle}>
            <p style={{margin: 0, fontSize: '60px', fontWeight: 'bold'}}>Spotify Playlist Generator</p>
            <div style={{display: 'flex', marginInlineEnd: '3px'}}>
                <a><IoLogoGithub style={{float: 'right', position: 'relative'}} /></a>
            </div>
        </div>
    )
}

export default Navbar
